import React, { useEffect, useState } from 'react';
import SideNavbar from '../../Components/SideNavbar';
import TableComponents from '../../Components/TableComponents';
import { THead, TBody } from '../../dataDummy/students';
import { useNavigate } from 'react-router-dom';

export default function Students() {
  const [THeadStudents, setTHeadStudents] = useState(THead);
  const [TBodyStudents, setTBodyStudents] = useState(TBody);
  const navigator = useNavigate();

  useEffect(() => {
    fetch('src/dataDummy/students.js')
      .then((response) => response.json())
      .then((data) => console.log(data));
  }, []);

  const handleEdit = (updatedStudent) => {
    console.log(`Edit student with ID: ${updatedStudent.id}`);
    console.log(`Updated Student Data:`, JSON.stringify(updatedStudent, null, 2));

    setStudents((prevStudents) =>
      prevStudents.map((student) =>
        student.id === updatedStudent.id ? updatedStudent : student
      )
    );

    // navigator(`/students/${id}`);
    // Logic untuk mengedit siswa
  };

  const handleDelete = (id) => {
    console.log(`Delete student with ID: ${id}`);
    // Logic untuk menghapus siswa
  };

  const handleClickAdd = () => {
    navigator('/students/add');
  };

  return (
    <div class='row'>
      <SideNavbar />

      <div class='col-10 pt-5'>
        <h2 className='text-center'>Students</h2>
        <div className='dashboard-content'>
          <TableComponents
            thead={THeadStudents}
            tbody={TBodyStudents}
            buttonName={'Add New Students'}
            handleDelete={handleDelete}
            handleClickAdd={handleClickAdd}
            handleEdit={handleEdit}
          />
        </div>
      </div>
    </div>
  );
}
